def solve():
    s = "t6 t3 t0"

    def is_generated(text, grammar):
        if not text:
            return False

        stack = []
        for char in text:
            if char in grammar.rules:
                stack.append(char)
            else:
                return False
        return len(stack) == 1

    def generate_string(grammar, string):
        if len(string) == 0:
            return True

        if len(string) == 1:
            return is_generated(string, grammar)

        for rule in grammar.rules:
            if rule == string:
                return True
            if rule in grammar.rules:
                if generate_string(grammar, string + rule):
                    return True
        return False

    if generate_string(s, s):
        print("Yes")
    else:
        print("No")

solve()
